import React, { Component } from 'react'
import {NavLink} from 'react-router-dom'

export class Navigation extends Component {
    render() {
        return (
            <ul className='nav'>
                <li><NavLink activeClassName = 'active' className = 'link' exact to = '/'>Home</NavLink></li>
                <li><NavLink activeClassName = 'active' className = 'link' exact to = '/AboutMe'>About Me</NavLink></li>
                <li><NavLink activeClassName = 'active' className = 'link' exact to = '/Projects'>Projects</NavLink></li>
            </ul>
        )
    }
}

export default Navigation
